selector_to_html = {"a[href=\"how-to/newspapers/newspapers-and-gazettes.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">16. </span>Newspaper and gazettes how to\u2026<a class=\"headerlink\" href=\"#newspaper-and-gazettes-how-to\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"introduction/introduction.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Introduction<a class=\"headerlink\" href=\"#introduction\" title=\"Permalink to this heading\">#</a></h1><p>We all know how to use <a class=\"reference external\" href=\"https://trove.nla.gov.au/\">Trove</a>. You just type your search terms into the box and click the button. You then work your way through the first few pages of results, saving anything that looks useful. If, for example, I\u2019m interested in the development of radio in Australia, I could search for the term \u2018radio\u2019 in Trove\u2019s digitised newspapers. It\u2019s easy!</p>", "a[href=\"what-is-trove/works-and-versions.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">4. </span>Works and versions<a class=\"headerlink\" href=\"#works-and-versions\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"collections-and-contexts/newspapers-missing-pages.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">9.2. </span>Missing newspaper pages and issues<a class=\"headerlink\" href=\"#missing-newspaper-pages-and-issues\" title=\"Permalink to this heading\">#</a></h1><p>This section will attempt some analysis of missing pages and issues in Trove\u2019s newspapers. As of 11 August 2023, I\u2019m running a very long harvest of essentially every article in Trove to try and get an idea of what\u2019s missing. This will never be precise, but it should at least provide a baseline and point to specific titles and periods that seem to be more affected.</p><p>Here\u2019s a <a class=\"reference external\" href=\"https://hcommons.social/@wragge/110845292959103039\">quick example using the Canberra Times</a>.</p>", "a[href=\"what-is-trove/trove-is.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Trove is\u2026<a class=\"headerlink\" href=\"#trove-is\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"accessing-data/newspapers-and-gazettes-articles.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.1. </span>Accessing data about newspaper and gazette articles<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-and-gazette-articles\" title=\"Permalink to this heading\">#</a></h1><p><img alt=\"Screenshot of Trove web interface displaying basic article metadata\" src=\"_images/trove-article-metadata.png\"/></p>", "a[href=\"collections-and-contexts/aggregated-collections.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11. </span>Aggregated collections<a class=\"headerlink\" href=\"#aggregated-collections\" title=\"Permalink to this heading\">#</a></h1><p>This sections will examine the collections aggregated into Trove.</p>", "a[href=\"collections-and-contexts/digitised-collections.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10. </span>Digitised collections<a class=\"headerlink\" href=\"#digitised-collections\" title=\"Permalink to this heading\">#</a></h1><p>This section will explore digitised collections, other than newspapers.</p>", "a[href=\"accessing-data/using-web-interface.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.1. </span>Downloading data from the Trove web interface<a class=\"headerlink\" href=\"#downloading-data-from-the-trove-web-interface\" title=\"Permalink to this heading\">#</a></h1><h2>Downloading images, PDFs, text, and audio<a class=\"headerlink\" href=\"#downloading-images-pdfs-text-and-audio\" title=\"Permalink to this heading\">#</a></h2><p>The official Trove Help includes a page on <a class=\"reference external\" href=\"https://trove.nla.gov.au/help/using-trove/downloading\">Downloading</a> that describes the options available in the various Trove categories for downloading images, PDFs, text, and audio. Different formats have different viewers, but generally speaking you just need to find the download tab in the sidebar, select a format, and click the button.</p>", "a[href=\"collections-and-contexts/newspapers-copyright.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">9.4. </span>Newspapers and copyright<a class=\"headerlink\" href=\"#newspapers-and-copyright\" title=\"Permalink to this heading\">#</a></h1><p>This section will examine both the impact of copyright restrictions on the construction of the Trove newspaper corpus, and the implications of copyright for researchers making use of digitised newspapers.</p><p>See <a class=\"reference external\" href=\"https://glam-workbench.net/trove-newspapers/Beyond_the_copyright_cliff_of_death/\">Beyond the copyright cliff of death</a> and <a class=\"reference external\" href=\"https://glam-workbench.net/trove-newspapers/csv-newspapers-post-54/\">Trove newspapers with articles published after 1954</a></p>", "a[href=\"collections-and-contexts/digitised-collections-oral-history.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10.5. </span>Oral history<a class=\"headerlink\" href=\"#oral-history\" title=\"Permalink to this heading\">#</a></h1><p>See <a class=\"reference external\" href=\"https://glam-workbench.net/trove-books/\">Trove Books</a> section of GLAM Workbench.</p>", "a[href=\"accessing-data/newspapers-and-gazettes-issues.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.3. </span>Accessing data about newspaper &amp; gazette issues<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-gazette-issues\" title=\"Permalink to this heading\">#</a></h1><h2><a class=\"toc-backref\" href=\"#id1\" role=\"doc-backlink\">Metadata</a><a class=\"headerlink\" href=\"#metadata\" title=\"Permalink to this heading\">#</a></h2><h3><a class=\"toc-backref\" href=\"#id2\" role=\"doc-backlink\">Get the number of issues per year for a title</a><a class=\"headerlink\" href=\"#get-the-number-of-issues-per-year-for-a-title\" title=\"Permalink to this heading\">#</a></h3><p>You can use the <code class=\"docutils literal notranslate\"><span class=\"pre\">newspaper/title</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">gazette/title</span></code> endpoints to get the total number of digitised issues per year for a newspaper or gazette title. You just add the <code class=\"docutils literal notranslate\"><span class=\"pre\">include</span></code> parameter and set its value to <code class=\"docutils literal notranslate\"><span class=\"pre\">years</span></code>.</p><p><a class=\"reference external\" href=\"https://troveconsole.herokuapp.com/v3/?url=https%3A%2F%2Fapi.trove.nla.gov.au%2Fv3%2Fnewspaper%2Ftitle%2F11%3Fencoding%3Djson%26include%3Dyears\"><img alt=\"Try it!\" src=\"_images/try-trove-api-console.svg\"/></a></p>", "a[href=\"what-is-trove/links-and-identifiers.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">5. </span>Links and identifiers<a class=\"headerlink\" href=\"#links-and-identifiers\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"accessing-data/trove-api-intro.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.2. </span>Trove API introduction<a class=\"headerlink\" href=\"#trove-api-introduction\" title=\"Permalink to this heading\">#</a></h1><h2>Types of requests:<a class=\"headerlink\" href=\"#types-of-requests\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"genindex.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Index<a class=\"headerlink\" href=\"#index\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"collections-and-contexts/newspapers-change-over-time.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">9.1. </span>How does the contents of the newspaper corpus change over time?<a class=\"headerlink\" href=\"#how-does-the-contents-of-the-newspaper-corpus-change-over-time\" title=\"Permalink to this heading\">#</a></h1><p>This section will examine how the contents of the newspaper corpus changes over time and the implications of this for researchers. This includes topics like:</p>", "a[href=\"collections-and-contexts/collections-and-contexts.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">8. </span>Collections and contexts<a class=\"headerlink\" href=\"#collections-and-contexts\" title=\"Permalink to this heading\">#</a></h1><p>This section will expand on some of the issues and questions raised in <a class=\"reference internal\" href=\"what-is-trove/trove-is.html\"><span class=\"doc std std-doc\">What is Trove?</span></a> section, looking in depth at what we can know about the contents of the different Trove cattgories and what this means for researchers.</p>", "a[href=\"glossary.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Glossary<a class=\"headerlink\" href=\"#glossary\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"how-to/newspapers/get-newspaper-issue-article-pdfs.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">16.2. </span>Get a newspaper issue or article as a PDF<a class=\"headerlink\" href=\"#get-a-newspaper-issue-or-article-as-a-pdf\" title=\"Permalink to this heading\">#</a></h1><p>You can download PDFs of newspaper and gazette articles, pages, and issues from Trove\u2019s web interface \u2013 it\u2019s just a matter of clicking a button. But downloading PDFs using computational methods is not so straightforward. When you click on the buttons in the web interface, you don\u2019t download the PDF from a fixed url. There\u2019s a bit of Javascript code behind the button that asks for for the PDF to be compiled, then alerts the user when it\u2019s ready. To automate the download process, you need to reproduce these steps in your code. This how-to provides an example of how this can be done using Python.</p>", "a[href=\"types-of-data/types-of-data.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">6. </span>Types of data<a class=\"headerlink\" href=\"#types-of-data\" title=\"Permalink to this heading\">#</a></h1><p>Types of data:</p>", "a[href=\"how-to/newspapers/create-newspaper-articles-dataset.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">16.4. </span>How to create a dataset of digitised newspaper articles<a class=\"headerlink\" href=\"#how-to-create-a-dataset-of-digitised-newspaper-articles\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"collections-and-contexts/digitised-collections-maps.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10.3. </span>Digitised journals and magazines<a class=\"headerlink\" href=\"#digitised-journals-and-magazines\" title=\"Permalink to this heading\">#</a></h1><p>See the <a class=\"reference external\" href=\"https://glam-workbench.net/trove-journals/\">Trove Journals</a> section of the GLAM Workbench.</p>", "a[href=\"collections-and-contexts/digitised-collections-manuscripts.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10.4. </span>Digitised manuscripts<a class=\"headerlink\" href=\"#digitised-manuscripts\" title=\"Permalink to this heading\">#</a></h1><p>See the <a class=\"reference external\" href=\"https://glam-workbench.net/trove-unpublished/\">Trove Unpublished</a> section of the GLAM Workbench.</p>", "a[href=\"collections-and-contexts/newspapers-ocr.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">9.5. </span>OCR quality and correction<a class=\"headerlink\" href=\"#ocr-quality-and-correction\" title=\"Permalink to this heading\">#</a></h1><p>This section will examine how the quality of OCR varies across the corpus and the significance of this for research uses. It will also look at patterns in OCR correction \u2013 what gets corrected and why.</p><p>See: <a class=\"reference external\" href=\"https://glam-workbench.net/trove-newspapers/Analysing_OCR_corrections/\">Analyse rates of OCR correction</a></p>", "a[href=\"references.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">References<a class=\"headerlink\" href=\"#references\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"accessing-data/newspapers-and-gazettes.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13. </span>Newspapers and gazettes<a class=\"headerlink\" href=\"#newspapers-and-gazettes\" title=\"Permalink to this heading\">#</a></h1><p><mark>==This might link to a fuller discussion in the contexts section?==</mark></p><p>Before you start requesting data from Trove\u2019s digitised newspapers, it\u2019s worth thinking a bit about the way newspapers are represented in Trove and the relationships between <strong>articles</strong>, <strong>pages</strong>, <strong>issues</strong>, and <strong>titles</strong>. You might think that newspapers are organised in a simple hierarchical structure with titles at the top, and articles at the bottom, but it\u2019s not quite that straighforward. Articles are linked to both pages and titles. Titles have their own API endpoint that can lead you to issues, though following an issue url will actually take you to a page. Pages have identifiers, and you can browse their contents in the Trove web interface, but they don\u2019t exist as separate entities in the API. These sorts of oddities mean that sometimes there\u2019s no direct route to the information that you want, but by thinking about what is connected to what, you can find alternative paths. For example, while there\u2019s no direct link between issues and articles, if you get the publication date and title from an issue, you can then search for articles published in that issue by using the <code class=\"docutils literal notranslate\"><span class=\"pre\">date</span></code> index and <code class=\"docutils literal notranslate\"><span class=\"pre\">title</span></code> facet.</p>", "a[href=\"collections-and-contexts/digitised-collections-journals.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10.2. </span>Digitised maps<a class=\"headerlink\" href=\"#digitised-maps\" title=\"Permalink to this heading\">#</a></h1><p>See the <a class=\"reference external\" href=\"https://glam-workbench.net/trove-maps/\">Trove Maps</a> section of the GLAM Workbench.</p>", "a[href=\"how-to/newspapers/querypic.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">16.1. </span>Visualising newspaper searches with QueryPic<a class=\"headerlink\" href=\"#visualising-newspaper-searches-with-querypic\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"demo.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Jupyter Book demo page<a class=\"headerlink\" href=\"#jupyter-book-demo-page\" title=\"Permalink to this heading\">#</a></h1><p>Trove is not one thing. <span id=\"id1\">[<a class=\"reference internal\" href=\"references.html#id18\" title=\"Tim Sherratt. Hacking Heritage: Understanding the Limits of Online Access. In H Lewi, W Smith, D von Lehn, and S Cooke, editors, The Routledge International Handbook of New Digital Practices in Galleries, Libraries, Archives, Museums and Heritage Sites, pages 116\u2013130. Routledge, London, 2019. doi:10.5281/zenodo.5035855.\">Sherratt, 2019</a>]</span></p>", "a[href=\"collections-and-contexts/newspaper-corpus.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">9. </span>Understanding the newspaper corpus<a class=\"headerlink\" href=\"#understanding-the-newspaper-corpus\" title=\"Permalink to this heading\">#</a></h1><p>This section will examine the way in which the Trove newspaper corpus has been constructed, and how its contents have changed over time.</p>", "a[href=\"accessing-data/downloadable-datasets.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3. </span>Downloadable datasets<a class=\"headerlink\" href=\"#downloadable-datasets\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"accessing-data/trove-lists.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">14. </span>Trove lists<a class=\"headerlink\" href=\"#trove-lists\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">14.1. </span>Metadata<a class=\"headerlink\" href=\"#metadata\" title=\"Permalink to this heading\">#</a></h2><h3>Getting list metadata using the web interface<a class=\"headerlink\" href=\"#getting-list-metadata-using-the-web-interface\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"accessing-data/newspapers-and-gazettes-pages.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.2. </span>Accessing data about newspaper &amp; gazette pages<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-gazette-pages\" title=\"Permalink to this heading\">#</a></h1><p><img alt=\"Screenshot of the masthead at the top of a newspaper page\" src=\"_images/16635065-level4-cropped.jpg\"/></p>", "a[href=\"#welcome-to-the-trove-data-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Welcome to the Trove Data Guide<a class=\"headerlink\" href=\"#welcome-to-the-trove-data-guide\" title=\"Permalink to this heading\">#</a></h1><p>This guide will help you hone your data wrangling skills and develop a critical understanding of Trove as a source for digital research.</p>", "a[href=\"what-is-trove/metadata-and-digital-objects.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3. </span>Metadata and digital objects<a class=\"headerlink\" href=\"#metadata-and-digital-objects\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"accessing-data/data-access-options.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12. </span>Data access options<a class=\"headerlink\" href=\"#data-access-options\" title=\"Permalink to this heading\">#</a></h1><p><strong>This section documents ways of accessing <span class=\"xref std std-term\">machine-readable</span> data from Trove. The focus is on reusable and extensible methods that can be used in a variety of workflows, such as the creation of datasets for further analysis.</strong></p><p>There are many different <span class=\"xref myst\">types of data</span> available from Trove and many different ways of accessing it. You can manually download some data, such as images, from Trove\u2019s web interface. If you\u2019re creating small, selective datasets, these manual methods might be all you need.</p>", "a[href=\"accessing-data/newspapers-and-gazettes-titles.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.4. </span>Accessing data about newspaper &amp; gazette titles<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-gazette-titles\" title=\"Permalink to this heading\">#</a></h1><p>\u2018Titles\u2019 in this context refers to the names of the publications whose articles are digitised in Trove. For example: <em>Canberra Times</em>, <em>Sydney Morning Herald</em>, or <em>Commonwealth of Australia Gazette</em>.</p>", "a[href=\"pathways/pathways.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">15. </span>Research pathways<a class=\"headerlink\" href=\"#research-pathways\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"how-to/newspapers/international-newspaper-titles.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">16.3. </span>Get a list of \u2018International\u2019 newspapers and gazettes<a class=\"headerlink\" href=\"#get-a-list-of-international-newspapers-and-gazettes\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"collections-and-contexts/newspapers-non-english.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">9.3. </span>Non-English language newspapers<a class=\"headerlink\" href=\"#non-english-language-newspapers\" title=\"Permalink to this heading\">#</a></h1><p>See <a class=\"reference external\" href=\"https://glam-workbench.net/trove-newspapers/find-non-english-newspapers/\">Finding non-English newspapers in Trove</a> in the GLAM Workbench and the <a class=\"reference external\" href=\"https://glam-workbench.net/trove-newspapers/list-non-english-newspapers/\">list of non-English language newspapers</a>.</p><p>Discuss implications for search and OCR correction.</p>", "a[href=\"understanding-search/understanding-search.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">7. </span>Understanding search<a class=\"headerlink\" href=\"#understanding-search\" title=\"Permalink to this heading\">#</a></h1><p>Searching collections of digital resources is a research method. Need to understand options and plan approach, recognising the limits of any search interface.</p><p>Search enables you to find items of relevance to your research and assemble a dataset for further analysis. Creating search queries is an iterative process \u2013 refining parameters, checking results etc.</p>", "a[href=\"what-is-trove/categories-and-zones.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>Categories and zones<a class=\"headerlink\" href=\"#categories-and-zones\" title=\"Permalink to this heading\">#</a></h1><p>Trove\u2019s resources are divided into <strong>categories</strong>. Understanding the nature and content of these categories will help you construct effective searches and access useful data.</p><p>There are nine categories in Trove:</p>", "a[href=\"collections-and-contexts/digitised-collections-books.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10.1. </span>Digitised books<a class=\"headerlink\" href=\"#digitised-books\" title=\"Permalink to this heading\">#</a></h1><p>See <a class=\"reference external\" href=\"https://glam-workbench.net/trove-books/\">Trove Books</a> section of GLAM Workbench.</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
